import {CartTableContainer, TableHeader, Row} from "./cart-table.styles";
const CartTable = () => {
  return (
   <CartTableContainer>
     <TableHeader>
       <Row product>Mặt Hàng</Row>
       <Row>Giá</Row>
       <Row>Số lượng</Row>
       <Row>Thành tiền</Row>
       <Row></Row>
     </TableHeader>
   </CartTableContainer>
  )
}

export default CartTable
